  \"2016-07-27T22:57:06.943439\",\n\t\"name\": \"final-environmental-assessment-proposal-to-expand-the-boundary-of-back-bay-national-wildli\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Historically recognized for its large wintering
  waterfowl populations and its sport fishery, the Back Bay area is undergoing land
  use changes that will potentially impact important wildlife habitat. These expected
  changes in land use patterns over the next several years will limit both the quality
  and quantity of available wildlife habitat through the direct loss of habitat and
  resultant degradation of the Bay.In this Environmental Assessment, the U.S. Fish
  and Wildlife Service (Service) describes a variety of alternatives that could provide
  long-term protection to important wildlife habitat located to the north and west
  of Back Bay National Wildlife Refuge in the city of Virginia Beach. Based on detailed
  study and considerable public comment, the Service will recommend approval of Alternative
  II, the Proposed Action. This alternative identifies approximately 6,340 acres of
  important wildlife habitat consisting of brackish marsh, forested swamp, and low-lying
  agricultural fields and woodlands within the original study area.\",\n\t\"license_title\":
